,NULL,'N','1677492652271write_4.PNG',1,1),(106,'someus',NULL,'강아지랑 산책하려고 했는데 비가 오기 시작하더니 강아지가 미쳐날뛰기 시작하다가 다행이도 날이 살짝 개어서 우리 예삐랑 산책을 다녀왔다. 예삐야 오래도록 주인이랑 행복해야 한다.~','2023-02-27 19:28:26',NULL,'N','1677493706107write_5.PNG',4,5),(107,'someus',NULL,'오늘 병원에 갔는데 허리디스크라 그러면서 운동을 하면안된다 그랬다 ㅠㅠ\n실기 1달 남았는데.... 망.....\n주사까지 맞고 왔는데 너무 아파서 눈물이 핑 돌았다.\n병원비도 많이 나오고 정말 이러면 안되는데.....\n그냥 다 놓아버리고 싶다','2023-02-27 19:49:32','2023-02-27 19:54:28','Y','1677494972580write_11.PNG',5,5),(108,'someus',NULL,'대전에 오랜만에 내려가는데\n둔산동은 정말 오랜만에 가는 거였다.\n\n작년 겨울쯤 아부지와 친언니랑\n잠깐 저녁 먹으러 간 적 있긴하지만,\n이렇게 친구와 놀려고 온거는 거의\n3-4년 만인 것 같았다.​\n\n대전은 서울에 비해 유난히 건물의 높이가\n낮은 편인데, 둔산동은 서울과 비슷한\n건물 높이라서 그런지\n대전에 온 것 같은 기분이 들진 않았다.\n\n그러면서도 대전에서 살았을 때\n친구들과 간간히 둔산동에서 놀았던\n추억들이 떠오르니 새록새록했다.','2023-02-27 19:54:48',NULL,'N','1677495288109write_13.PNG',2,2),(109,'someus',125,'회사 들어가고 얼마 안되서\n이렇게까지 불만을 말해본 건\n생에 처음이었는데,\n요상하게 불안했다.\n\n행여나 잘못 말한 걸까 싶었던 거다\n솔직히 들어간지 얼마 안되어서\n말하기 싫었는데\n너무 체계가 아니어서 말한 것도 있었다.\n\n그런 저런 마음에\n\n잠 좀 설치다가\n개운하지 못하게 일어났다.','2023-02-25 20:07:43',NULL,'N','1677496063160write_10.PNG',2,3),(110,'someus',125,'오후에 출근하면서\n\n지니뮤직을 틀었는데\n마이 뮤직컬러를 보았다.\n\n이달에는 참 다채로운 컬러들이 있었다.\n평소대로면 베이지컬러만 나왔는데\n신기하고 괜히 즐거웠다.','2023-02-27 20:08:26',NULL,'N','1677496106055write_3.PNG',2,2),(111,'someus',125,'오늘 아침, 진심으로 회사 나갈까 생각했다.​\n\n체계가 안잡힌 곳에 혼자 디자이너로 일을 하고\n의뢰자 6-7명을 케어하려고 하니\n쉬운 일이 아니라 생각하는데,\n마치 내가 이 곳에 1년을 일한 듯이 일을 주셨다.\n\n그래도 좋게 일을 할려고 온 건데\n회사를 나갈 생각을 하지말자고\n곧장 다짐하고 출근 준비를 했다.','2023-01-27 20:11:25',NULL,'N','1677496285333write_8.PNG',2,3),(112,'someus',125,'오늘 아침, 진심으로 회사 나갈까 생각했다.​\n\n체계가 안잡힌 곳에 혼자 디자이너로 일을 하고\n의뢰자 6-7명을 케어하려고 하니\n쉬운 일이 아니라 생각하는데,\n마치 내가 이 곳에 1년을 일한 듯이 일을 주셨다.\n\n그래도 좋게 일을 할려고 온 건데\n회사를 나갈 생각을 하지말자고\n곧장 다짐하고 출근 준비를 했다.','2023-01-25 20:11:41',NULL,'N','1677496301434write_7.PNG',1,2),(113,'someus',125,'오늘 아침, 진심으로 회사 나갈까 생각했다.​\n\n체계가 안잡힌 곳에 혼자 디자이너로 일을 하고\n의뢰자 6-7명을 케어하려고 하니\n쉬운 일이 아니라 생각하는데,\n마치 내가 이 곳에 1년을 일한 듯이 일을 주셨다.\n\n그래도 좋게 일을 할려고 온 건데\n회사를 나갈 생각을 하지말자고\n곧장 다짐하고 출근 준비를 했다.','2023-01-22 20:1